import React, { useState } from "react";
import Todo from "./Todo";
import '../App.css'

const ToDoList = ({ todos,setTodos }) => {
    return(
      <div className="todo-container">
        <ul className="todo-list">
         {todos.map((todo) => (
          <Todo  
            setTodos={setTodos}
            todos={todos}
            key={todo.id} 
            text={todo.text}
          / >
         ))}
        </ul>
      </div>
    );
};


export default ToDoList;
